import './App.css';
import './index.css';
import { Navbar } from './Components/Navbar';
import {Option} from'./Components/Option';

function App() {
  return (
    <div id="RideRental">

     
      <Navbar></Navbar>
      
      <div className='op'>
        <Option></Option>
      </div>
    </div>
  );
}

export default App;
